import React from 'react';
import FormGroup from '@material-ui/core/FormGroup';
import FormControlLabel from '@material-ui/core/FormControlLabel';
import Switch from '@material-ui/core/Switch';




export default function SwitchLabels(props) {
  const handleChange = () =>{
      props.checkedEasy = !props.checkedEasy;
  };
  return (
    <FormGroup row>
      <FormControlLabel
        control={
          <Switch checked={props.checkedEasy}
          onChange={this.handleChange()}
          value="checkedEasy"
          />
        }
        label="Easy Game"
      />
      <FormControlLabel
        control={
          <Switch
            checked={props.checkedMedium}
            onChange={this.handleChange()}
            value="checkedMedium"
            color="primary"
          />
        }
        label="Medium"
      />
    </FormGroup>
  );
}
